import React from "react";


type TypeModalEndProps = {
    winner: string | null;
}


const ModalEnd: React.FC <TypeModalEndProps> = ({winner}) => {

    const result = (winner: string | null) => {
        if(winner === "x") {
            return "X"
        } else if (winner === "o") {
            return "O"
        }
        return "Ничья"
    }


    return(
        <div className="container_modalEnd">
            {winner
            ? <h1>{winner}</h1>
            : <h1>Ничья</h1>
            }
        </div>
    )
}

export default ModalEnd;
